//   align-items: center;
//   justify-content: center;
//   gap: 20px;
//   background: pink;
//   color: white;
//   padding: 20px;
// `;

// const StyledLink = styled(Link)`
//   color: green;
// `;

const Navbar = () => {
  return (
    <NavbarWrapper>
      <StyledLink to="/">HOME</StyledLink>
      <StyledLink to="/login">LOGIN</StyledLink>
      <StyledLink to="/bookings">BOOKINGS</StyledLink>
    </NavbarWrapper>
  );
};

export default Navbar;
